<p class="title">●帆布工房 トートバッグ 男女兼用 LAYERED2(レーヤード2)独特のくたっと感が可愛い！ 大きめサイズ トートバッグ(木綿 麻 3X61 3×61)</p>
帆布工房 トートバッグ 男女兼用 LAYERED2(レーヤード2)独特のくたっと感が可愛い！ 大きめサイズ 3×61 トートバッグ(木綿 麻)8号帆布をソフトタッチに仕上げ独特のクタ感を持たせた「帆布工房レイヤード2」シリーズの<br>トートバッグです。<br>重ねた部分は全てポケットとして使用でき、本体口の開閉はマグネットホック、ファスナーの両方の使用が可能です。 大きめサイズなので、アウトドアレジャーや、1泊旅行、マザーバッグとしても使っていただけます。 本体内側には、携帯ポケットと、オープンポケット、ファスナーポケットの3つがあり、小物の収納にも便利です。<br>重ね着したようなイメージで、男性、女性問わず持っていただける色コンビも素敵です。<br>前本体に付いたナスカンは、デザインのアクセントとしても、<br>キーセーブとしても使っていただけます。<br>ご自身で、カスタマイズしてお好きなキーホルダー等を付けていただいてもいいですね☆ <br><br />
